import Header from '../../components/Header';
import Title from '../../components/Title';

import { FiSettings } from 'react-icons/fi';
export default function Profile() {
  return (
    <div>
      <Header />
      <div className="content">
        <Title>
          <FiSettings size={25} />
        </Title>
      </div>
      <h1>Profile</h1>
    </div>
  );
}
